  true,\n\t\"url\": null,\n\t\"notes\": \"IUPAC Ionic Liquids Database, ILThermo,
  is a free web research tool that allows users worldwide to access an up-to-date
  data collection from the publications on experimental investigations of thermodynamic,
  and transport properties of ionic liquids as well as binary and ternary mixtures
  containing ionic liquids. The database can be searched by means of the ions constituting
  the ionic liquids, the ionic liquids themselves, their properties, and references.
